import React from 'react';
import style from "./Content.module.css"

const Content = () => {
    return(
        <div className={style.wrapper}>
            {/* <div className={style.content}> */}
                <div className={style.menu}>
                    <div className={style.assortment}>
                        <div>Fender</div>
                        <div>Gibson</div>
                        <div>Ibanez</div>
                        <div>asdadda</div>
                        <div>asdasd</div>
                    </div>
                </div>
                <div className={style.items}>
                    <div className={style.item}>strat1</div>
                    <div className={style.item}>strat2</div>
                    <div className={style.item}>strat3</div>
                    <div className={style.item}>strat4</div>
                    <div className={style.item}>strat5</div>
                </div>
            {/* </div> */}
        </div>
    )
};

export default Content;
